import React from 'react';
import { Formik, Field, Form } from 'formik';

const FormikCloudForm = () => (
  <Formik
    initialValues={{
      name: '',
      email: '',
      message: ''
    }}
    onSubmit={values => {
      fetch('https://api.formik.com/submit/portfolio-site-form/portfolio-site-form', {
        method: 'POST',
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(values),
      });
    }}
    render={() => (
      <Form className='form'>
        <label for="name" className="input">Name:</label>
        <Field name="name" />

        <label for="email" className="input">Email:</label>
        <Field name="email" />

        <label for="message" className="textarea">Message:</label>
        <Field name="message" />

        <button type="submit">Submit</button>
      </Form>
    )}
  />
);

export default FormikCloudForm;
